const exceptions: ITrie = [0,{"ck":[0,{"www":_0}],"jp":[0,{"kawasaki":_2,"kitakyushu":_2,"kobe":_2,"nagoya":_2,"sapporo":_2,"sendai":_2,"yokohama":_2}],"dev":[0,{"hrsn":[0,{"psl":[0,{"wc":[0,{"ignored":_1,"sub":[0,{"ignored":_1}]}]}]}]}]}];
  return exceptions;
